// Skiff Icons - Simple SVG icon library for React
import React from 'react';

// Declare require for SVG imports
declare const require: any;

// TypeScript interfaces
export interface IconProps extends React.SVGProps<SVGSVGElement> {
  size?: number | string;
  color?: string;
  className?: string;
}

// Individual icon components with enhanced props
const createIcon = (SvgComponent: React.ComponentType<React.SVGProps<SVGSVGElement>>) => {
  const Icon: React.FC<IconProps> = ({ size = 24, color = 'currentColor', className, ...props }) => (
    <SvgComponent
      width={size}
      height={size}
      fill={color}
      className={className}
      {...props}
    />
  );
  Icon.displayName = `Icon`;
  return Icon;
};

